Τι θες να φας;
Εσένα. 

*και κάπως έτσι ξεκίνησε.

- Το 2011 χωρίσαμε
 - Είχατε ολοκληρώσει;  
 - Ναι  με φίλησε και στο άλλο μάγουλο #BigBrotherGR

Δηλαδή αν ο Τσίπρας με την Μπαζιάνα έπαιρναν εικονικό διαζύγιο, θα τον ψηφίζατε;
Αν η Μπαζιάνα είχε Οφσόρ αδήλωτες;
Ο Τσίπρας απλήρωτα δάνεια;
Θα τους ψηφίζατε;

Η κ. #Γκαγκα: «Θα πρέπει σε λίγο να διαλέξουμε αν θα νοσηλευθεί ασθενής με κορονοϊό ή με εγκεφαλικό».

Ο κ. #Σκερτσος: «Δεν υπάρχει και λόγος να δημιουργήσουμε ένα πολυτελές σύστημα υγείας».

Είναι πράγματι η κυβέρνηση έτοιμη να τελέσει ανθρωποκτονία δια παραλείψεως κατά συρροή;

Έρχεται η άλλη να κάτσει να πιει καφέ: ένα εσπρεσακι μου λέει. Ναι της λέω, είναι εύκολο να έχω κάποιο έγγραφο για τον Covid;
Ακόμα κ για το εσπρεσακι ρε παιδιά μου λέει;
Ναι, δεν το ξέραμε να ζητάμε χαρτιά μόνο σε όσους πίνουν καπουτσίνο ας πούμε.
